//next에서 제공하는 기능으로 해당 _app.js로 파일명을 가져가면
//자동으로 레이아웃이 된다. index, profile 등 모든 파일이 이걸 부모 컴포넌트로 사용함
import React from "react";
import AppLayout from "../components/AppLayout";
import PropTypes from "prop-types";
import Head from "next/head";

const NodeBird = ({ Component }) => {
  return (
    <div>
      <Head>
        <title>NodeBird</title>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.18.1/antd.css"
        />
        <script src="http://cdnjs.cloutflare.com/ajax/libs/antd/3.18.1/antd.js" />
      </Head>
      <AppLayout>
        <Component></Component>
      </AppLayout>
    </div>
  );
  NodeBird.propTypes = {
    Component: PropTypes.elementType,
    // 여기서 node: JSX에 들어갈 수 있는 모든 것들(문자열, 컴포넌트 등)
  };
};

export default NodeBird;

//페이지들의 공통적인 부분을 모아놓음
//<Component/>는 자식컴포넌트에서 가져오는 것임(next기능)
